window.bookSummaryJSON = "<p>Mel Robbins is back! The international bestselling phenomenon and creator of<i> The Five Second Rule </i>and <i>Kick Ass with Mel Robbins </i>returns to help you tackle the single biggest obstacle you face: <i>fear</i>. This life-changing Audible Original features a powerful mix of one-on-one life-coaching sessions and a personal narrative with vital take-aways that you can start using immediately. </p> <p>With humor and wisdom, Mel Robbins expertly tackles the fear of change, rejection, and being alone, as well as imposter syndrome and feeling trapped in the wrong career. Each session is a goldmine of discovery as Mel guides you to find your purpose, improve your relationships, and ultimately take control of your life. In these times of high anxiety, it’s easy to feel overwhelmed - that changes right now. If you want the tools to break free from fear and live to your fullest potential, this is a must-listen.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
